<script>
    function duereport() {
        var startdate = $('#Feesallocation_startdate').val();
        var enddate = $('#Feesallocation_enddate').val();
        $('#reportforduelist tbody').empty();
         $('#overlaygif').show("slow");
        $.ajax({
            type: "POST",
            url: "feeduereports",
            data: {startdate: startdate, enddate: enddate},
            dataType: "html",
            success: function (data) {
                 $('#overlaygif').hide("slow");
                $('#reportforduelist tbody').append(data);
                $('#gridview111').show();

            }
        });
    }
    $(document).ready(function () {
        var droplist = $('#Feesallocation_feestype11');
